import React, { Component } from "react";
import {
    Row,
    Col,
  } from "react-bootstrap";

class TravelAdvice extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <Row>
            <Col md={12} style={{paddingLeft: "2"}}>

            <h4 >Widespread sustained (ongoing) transmission and restrictions on entry to the United States</h4>

          </Col>
        </Row>
        <div class="row ">
          <div class="col-md-12">
            <div class="row-fluid">
              <div class="vc_empty_space col-12 pt-3 pb-1">
                <span class="vc_empty_space_inner"></span>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default TravelAdvice;
